INSERT INTO `announcements` (`id`, `user_id`, `message`, `created_at`, `updated_at`) VALUES (1,1,'This is the initial production version of the Workshop online managing application. This version still has multiple bugs and the first update intended to resolve most of them will soon be released. In the meantime, you are kindly asked to test the application as much as possible and report any noticed bugs to the development team using email addresses provided in the footer. We are looking forward to your feedback!','2017-08-03 19:17:02','2017-08-03 19:17:02'),(3,1,'Students should fill their details on the website and request jobs.\r\nThey should NOT start the print until you accept the job!\r\nAs they wonâ€™t be aware of this new procedure, please do point them at the website as they get to the workshop!','2017-08-04 18:46:15','2017-08-04 18:46:15'),(4,1,'The statuses of all printers and issues associated with them have been brought into order with the current state of affairs. There is one exception with printer 7 though. \r\n\r\nWe have also introduced access to the website using encrypted protocol https. In order to start using it type https://3dprint.clients.soton.ac.uk and proceed by ignoring all warnings, that your web browser might issue.','2017-10-08 20:10:18','2017-10-08 20:10:18'),(5,1,'In response to a suggestion by Andy Everitt we introduce that from now on if the print is cancelled by a 3D hubs manager or a demonstrator, the cost will automatically go to zero.\r\n\r\nDevelopment team.','2017-10-16 14:44:52','2017-10-16 14:44:52'),(6,2,'The statuses of all printers and issues associated with them have been brought into order with the current state of affairs. There is one exception with printer 7.\r\nDevelopment team.','2017-10-29 17:17:50','2017-10-29 17:17:50');
